import React from "react";
import { Navbar, Button, Link } from "@nextui-org/react";
import { Layout } from "./Navbar/Layout.js";
import { AcmeLogo } from "./Navbar/AcmeLogo.js";
import { VariantsSelectorWrapper } from "./Navbar/VariantsSelectorWrapper.js";
import { Text } from "@nextui-org/react";

export default function App() {
  const [variant, setVariant] = React.useState("static");

  const variants = ["static", "floating", "sticky"];

  return (
    <Layout>
      <Navbar isBordered variant={variant}>
        <Navbar.Brand>
          <AcmeLogo />
          <Text b color="inherit" hideIn="xs">
            OSIRIS
          </Text>
        </Navbar.Brand>
        <Navbar.Content hideIn="xs">
          <Navbar.Link href="#">Home</Navbar.Link>
          <Navbar.Link isActive href="#">Features</Navbar.Link>
          <Navbar.Link href="#">Purchase</Navbar.Link>
        </Navbar.Content>
        <Navbar.Content>
          <Navbar.Item>
            <Button auto flat as={Link} href="#">
              Purchase
            </Button>
          </Navbar.Item>
        </Navbar.Content>
      </Navbar>

      <>
      <Text size="$xs">Font Size: xs</Text>
      <Text size="$md">Font Size: md (base)</Text>
      <Text size="$xl">Font Size: xl</Text>
      <Text size="$2xl">Font Size: 2xl</Text>
      <Text size="$3xl">The Greatest Streamable</Text>
    </>
    </Layout>
  );
}
